// 프론트엔트에서 API 호출하기

export const fetchSchedule = (year, month, team) => {
  return fetch(
    `http://localhost:5001/api/schedule?year=${year}&month=${month}&team=${team}`
      .then((response) => response.json())
      .catch((error) => {
        console.error("API 호출 오류:", error);
        throw error;
      })
  );
};
